import * as React from 'react'
import { Container, View, Image } from '../../components/atoms'

import './shots.scss'

class Shots extends React.Component{

    render(){
        return(
            <Container>
                <View>
                    <Image src={require('../../static/unsplash/shots-hero.jpg')}/>
                </View>
            </Container>
        )
    }
}

export default Shots
